import React, { useState } from "react";
import "./index.css";


const App = () =>{

    const [count ,setCount] = useState(0);
    function clicks(){
        setCount(count + 1);
    }
    return (
        <>
            <h1>{count}</h1>
            <button onClick = {clicks}>click me </button>
        </>
    )
}
  

export default App;
